import React from 'react';
import { useNavigate } from 'react-router-dom';

const LandingPage = () => {
  const navigate = useNavigate();

  const handleStartNow = () => {
    navigate('/intake');
  };

  return (
    <div className="container">
      <div className="card" style={{ textAlign: 'center', padding: '60px 24px' }}>
        <h1 style={{ fontSize: '3rem', marginBottom: '20px', color: '#007bff' }}>
          Smart Care Routing Agent
        </h1>
        <p style={{ fontSize: '1.5rem', marginBottom: '30px', color: '#666' }}>
          Find the perfect healthcare provider for your needs in minutes
        </p>
        <div style={{ maxWidth: '600px', margin: '0 auto 40px' }}>
          <p style={{ fontSize: '1.1rem', lineHeight: '1.6', color: '#555' }}>
            Our intelligent system matches you with the best healthcare providers based on your symptoms, 
            location, and insurance coverage. Get personalized recommendations and book appointments 
            with just a few clicks.
          </p>
        </div>
        <div style={{ display: 'flex', gap: '20px', justifyContent: 'center', flexWrap: 'wrap' }}>
          <div style={{ textAlign: 'center', flex: '1', minWidth: '200px' }}>
            <div style={{ fontSize: '2rem', marginBottom: '10px' }}>üè•</div>
            <h3>Smart Matching</h3>
            <p>AI-powered provider recommendations</p>
          </div>
          <div style={{ textAlign: 'center', flex: '1', minWidth: '200px' }}>
            <div style={{ fontSize: '2rem', marginBottom: '10px' }}>üí∞</div>
            <h3>Cost Transparency</h3>
            <p>Know your out-of-pocket costs upfront</p>
          </div>
          <div style={{ textAlign: 'center', flex: '1', minWidth: '200px' }}>
            <div style={{ fontSize: '2rem', marginBottom: '10px' }}>üìÖ</div>
            <h3>Easy Booking</h3>
            <p>Book appointments instantly</p>
          </div>
        </div>
        <button 
          className="btn btn-primary" 
          onClick={handleStartNow}
          style={{ fontSize: '1.2rem', padding: '16px 32px' }}
        >
          Start Now
        </button>
      </div>
    </div>
  );
};

export default LandingPage;
